import Card from './Components/Card';


import data from "./Components/data";

function reflectcard()
{
    for (let i = 0; i < data.length; i++) {
      return (
        <>
          <Card>
            title = data[i].title;
            imglink = data[i].imglink
            info = data[i].info
          </Card>
        </>
      )

    }
}


function App() {
  return (
    <div className="App">

      <div className="cardblock">

          {/* <Card 
          title = {data[0].title}
